export interface Population {
    id: number;
    country: string;
    year: number;
    totalMale: string;
    totalFemale: string;
}




export function fetchData(searchTerm: string, sortBy: string, sortDirection: string): Promise<Population[]> {
    const dataUrl =
        ` https://localhost:7185/Population?searchTerm=${searchTerm}&sortBy=${sortBy}&sortDirection=${sortDirection}`;
    return fetch(dataUrl)
        .then((r) => r.json())
}
